import React from "react";
import Fullcalendar from "@fullcalendar/react";
import dayGridPlugin from "@fullcalendar/daygrid";
import timeGridPlugin from "@fullcalendar/timegrid";
import interactionPlugin from "@fullcalendar/interaction";
import { Link } from "react-router-dom"; // Import Link from react-router-dom

function Calendar() {
  return (
    <div>
      <Fullcalendar
        plugins={[dayGridPlugin, timeGridPlugin, interactionPlugin]}
        initialView={"dayGridMonth"}
        headerToolbar={{
          start: "today prev,next", // normally on the left, if RTL, on the right
          center: "title",
          end: "dayGridMonth,timeGridWeek,timeGridDay", // normally on the right, if RTL, on the left
        }}
        height={"90vh"}
      />
      
      {/* Add the Return button at the bottom */}
      <div style={{ textAlign: "center", marginTop: "20px" }}>
        <Link to="/PlanFrontPage">
          <button className="Return-button">Return to Home</button>
        </Link>
      </div>
    </div>
  );
}

export default Calendar;
